import './ExpenseItem.css'

const Expense = () => {
    return (
        <div className='expense-item'>
            <div>28th March 2022</div>
            <div className='expense-item__description'>
                <h2>Car Insurance</h2>
                <div className='expense-item__price'>$3440</div>
            </div>
        </div>
    );
}

export default Expense;
